const languageList = [
    {id: 1, languageName: "Javascript"},
    {id: 2, languageName: "Python"},
    {id: 3, languageName: "Go"},
    {id: 4, languageName: "Java"},
    {id: 5, languageName: "Typescript"},
    {id: 6, languageName: "Ruby"},
    {id: 7, languageName: "Elixir"}
]

export default languageList;
